import React from "react";
import Card from "../components/Card";

export default function CocktailsList({ drinks }) {
  function setDetailsVisible() {}

  return (
    <div class="row">
      <div class="col s12 m8 l9">
        {drinks.drinks &&
          drinks.drinks.map(
            ({ strDrinkThumb, strDrink, strIBA, strAlcoholic }) => (
              <Card
                strDrinkThumb={strDrinkThumb}
                strDrink={strDrink}
                strIBA={strIBA}
                strAlcoholic={strAlcoholic}
                onClick={setDetailsVisible}
              />
            )
          )}
      </div>
      <div class="col s12 m4 l3 grey lighten-2 full-height">hello</div>
      <style global jsx>{`
        .full-height {
          height: 100vh;
        }
      `}</style>
    </div>
  );
}
